import logo from './logo.svg';
import './App.css';
import { Routes, Route } from 'react-router-dom'
import Container from './components/layouts/Container';

function App() {
  return (
    <div className="App">
      <Routes>
        <Container path='/' element={<Container />}>

        </Container>
      </Routes>
    </div>
  );
}

export default App;
